local function StrEscape(x)
	if not x:find('"') then
		return '"' .. x .. '"'
	elseif not x:find("[^\\]'") then
		return "'" .. x .. "'"
	else
		--error(":/ " .. x)
		return "'" .. x:gsub("([^\\])'", "%1\\'") .. "'"
	end
end

local function get(n)
	return UltList[n-157+1] -- oops 1 indexed language
end

