local Adjustments = 0
local function AdjustFirstT(target)
	while true do
		local s, r = pcall(function()
			return (
				-parseInt(get(1964)) / 1 + parseInt(get(497)) / 2 * (parseInt(get(1106)) / 3) + parseInt(get(2421)) / 4 + -parseInt(get(751)) / 5 + -parseInt(get(3099)) / 6 * (-parseInt(get(1705)) / 7) + -parseInt(get(2029)) / 8 + parseInt(get(3148)) / 9
			) == target
		end)
		if not s or not r then
			Adjustments = Adjustments + 1
			table.insert(UltList, table.remove(UltList, 1))
			if Adjustments > 200 then error(":( bad swap") end -- determined via js testing
		else
			break
		end
	end
end
